import React from "react";
import "./App.css";
import {DishData} from './data'

export function Dishes() {
    const dishList = DishData.map( (data, key) =>
        <tr key = {key}>
            <td>{data.title}</td>
            <td>{data.price}</td>
            <td>{data.category}</td>
        </tr>
    );
    return (
        <table> 
            <tr>
                <th>Name</th>
                <th>Category</th>
                <th>Price</th>
            </tr>
            {dishList}
        </table>);
}
